import './App.css'
import useWindowDimensions from './constants/Dimensions'

function App() {
  const { height, width } = useWindowDimensions()
  return (
    <div className="App">
      <div
        style={{
          height: height * 0.1,
          backgroundColor: 'red',
        }}
      ></div>
    </div>
  )
}

export default App
